import React, { useState } from 'react';
import { Button, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Login from './Login';
import Signup from './Signup';
import AdminLogin from './AdminLogin'; // Import AdminLogin component
// import './CustomNavbar.css'; // Add your CSS file for custom styling

const CustomNavbar = () => {
    const [showLogin, setShowLogin] = useState(false);
    const [showSignup, setShowSignup] = useState(false);
    const [showAdminLogin, setShowAdminLogin] = useState(false); // State for AdminLogin modal

    const handleLoginClose = () => setShowLogin(false);
    const handleSignupClose = () => setShowSignup(false);
    const handleAdminLoginClose = () => setShowAdminLogin(false); // Close admin modal

    const handleContactClick = () => {
        const element = document.getElementById('contact-details');
        if (element) {
            element.scrollIntoView({ behavior: 'smooth' });
        }
    };

    return (
        <Navbar expand="lg" className="navbar-custom">
            {/* Brand logo */}
            <Navbar.Brand as={Link} to="/" className="navbar-brand">
                <img src="/path-to-your-logo.png" alt="Brand Logo" className="brand-logo" />
                Tedy
            </Navbar.Brand>

            <Navbar.Toggle aria-controls="basic-navbar-nav" />

            {/* Navbar links */}
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link as={Link} to="/overview">Overview</Nav.Link>
                    <Nav.Link as={Link} to="/why-tedy">Why Tedy?</Nav.Link>
                    <Nav.Link as={Link} to="/resources">Resources</Nav.Link>
                    <Nav.Link as={Link} to="/demo">Demo</Nav.Link>
                    <Nav.Link as={Link} to="/pricing">Pricing</Nav.Link>
                </Nav>

                {/* Language Selector Dropdown */}
                <NavDropdown title="EN" id="language-dropdown" className="language-dropdown">
                    <NavDropdown.Item>EN</NavDropdown.Item>
                    <NavDropdown.Item>FR</NavDropdown.Item>
                    <NavDropdown.Item>ES</NavDropdown.Item>
                </NavDropdown>

                {/* CTA Button */}
                <Button className="cta-button" variant="primary">Talk to an Expert</Button>

                {/* Login/Signup Buttons */}
                <Button className="btn btn-outline-dark ml-2" onClick={() => setShowLogin(true)}>Sign In</Button>
                <Button className="btn btn-dark ml-2" onClick={() => setShowSignup(true)}>Sign Up</Button>
            </Navbar.Collapse>

            {/* Modals for Login, Signup, and AdminLogin */}
            <Login show={showLogin} handleClose={handleLoginClose} />
            <Signup show={showSignup} handleClose={handleSignupClose} />
            <AdminLogin show={showAdminLogin} handleClose={handleAdminLoginClose} />
        </Navbar>
    );
};

export default CustomNavbar;
